description:
Install And Play.....

Jewel Quest Mysteries 2: Trail of the Midnight Heart 

After answering her uncle's call, Eva Witheby winds up far from home and amidst strangers in a strange land. It's hard to know who to trust when treacherous trails and veiled secrets abound. Alongside Eva, uncover relics in eye catching hidden object screens. Unearth tools that will help you reveal shards of the precious jewel boards and discover all new scrolling search screens that put you in the front seat of whizzing planes and a whirlwind adventure!

System Requirements:
OS: Windows XP, Windows Vista (Tested On Windows 7)  
Memory: 1 GB 
CPU: P1 GHz 
Video: 16MB 


Please Note: 
Windows 7 Users Should Change Installation Path Other Than &quot;&quot;Program Files&quot;&quot;
Try Changing To Short Paths Like C:Games  Or D:Games


